import React from "react";
import "../styles.css";
import project1 from "./assets/project1.webp"
import project2 from "./assets/project.jpg"

const projects = [
  {
    title: "Women Safety Device",
    description: "An IoT-based device for women's safety, featuring GPS tracking and an emergency alert system.",
    github: "https://github.com/yourgithub/women-safety-device",
    image:project1
  },

  {
    title: "React Portfolio",
    description: "A sleek, modern portfolio built with React.js, showcasing my skills and projects.",
    github: "https://github.com/yourgithub/react-portfolio",
    image:project2

  },
  {
    title: "E-Commerce Website",
    description: "A fully responsive e-commerce website built using React and Firebase authentication.",
    github: "https://github.com/yourgithub/e-commerce-site",
  }
];

const Projects = () => {
  return (
    <section className="projects">
      <h2>Projects</h2>
      <div className="projects-grid">
        {projects.map((project, index) => (
          <div key={index} className="project-card">
            <img src={project.image} alt={project.title} className="project-image" /> {/* Display Image */}
            <h3>{project.title}</h3>
            <p>{project.description}</p>
            <a href={project.github} target="_blank" rel="noopener noreferrer" className="github-link">
              View on GitHub
            </a>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
